var tipuesearch = {"pages": [{'title': 'About', 'text': '', 'tags': '', 'url': 'About.html'}, {'title': '課堂常用連結', 'text': 'wcm2023\xa0 https://mde.tw/wcm2023/content/index.html \xa0 \n 5j-5jg2\xa0 https://github.com/mdewcm2023/5j-5jg2 \xa0 \n exam\xa0 http://exam.cycu.org/ \xa0(IPv6) \n', 'tags': '', 'url': '課堂常用連結.html'}, {'title': 'vocabulary', 'text': 'cambridge_english_vocabulary_list.pdf \n The_Oxford_5000.pdf \n \n', 'tags': '', 'url': 'vocabulary.html'}, {'title': 'Chat GPT', 'text': "ChatGPT \n Q:鋼的楊氏係數 \n \n A:鋼的楊氏係數（Young's modulus of elasticity）是一種物理量，用來描述鋼材料的彈性變形特性。 \n 楊氏係數是指在材料受力下，其在垂直於受力方向上的形變程度與受力程度之間的比值。一般而言，楊氏係數越大，表示該材料的形變程度越小，即具有較高的彈性模量。在工程材料中，鋼的楊氏係數通常是在 190 GPa 至 210 GPa 之間。 \n 楊氏係數可以通過實驗測試或理論計算來獲得。實驗測試通常是利用壓縮試驗或拉伸試驗來測量材料在不同應變程度下的應力，然後根據楊氏係數的定義來計算楊氏係數。理論計算方面，通常是利用分子動力學模擬、密度泛函理論等方法來獲得楊氏係數的值。 \n 需要注意的是，鋼材料的楊氏係數在不同溫度和應變速率下可能存在變化，因此在實際應用中需要根據具體情況來進行調整和修正。 \n \n Q: 何謂轉動慣量 \n \n A:轉動慣量（moment of inertia）是一個物理量，用來描述物體繞某一軸線旋轉時其慣性（即旋轉慣性）的大小。在旋轉運動中，物體對不同軸線的旋轉慣性是不同的，因此需要使用轉動慣量來描述物體的旋轉特性。 \n 轉動慣量的大小取決於物體的質量分佈和旋轉軸線的位置和方向。一般而言，物體的轉動慣量越大，其繞軸線旋轉時所需的能量越大，旋轉的穩定性也越高。 \n 對於一個質量分佈均勻的剛體，其繞通過其質心的任意軸線的轉動慣量可以通過以下公式計算： \n I = (1/12) * m * (a^2 + b^2) \n 其中，m 是剛體的質量，a 和 b 分別是剛體在兩個互相垂直的軸線上的半徑。需要注意的是，當剛體的質量分佈不均勻或者旋轉軸線不穿過質心時，計算轉動慣量的公式會更加複雜，需要利用積分等方法進行求解。 \n Q: 何謂轉動動能 \n \n A:轉動動能（rotational kinetic energy）是一個物理量，用來描述物體的旋轉運動所擁有的能量。在物體繞著某一軸線旋轉時，由於其具有角速度，因此也就擁有了轉動動能。 \n 對於一個質量分佈均勻的剛體，其繞通過其質心的任意軸線的轉動動能可以通過以下公式計算： \n K = (1/2) * I * ω^2 \n 其中，I 是剛體繞軸線的轉動慣量，ω 是剛體的角速度。可以看出，轉動動能的大小與物體的轉動慣量和角速度的平方成正比，因此，當物體的轉動速度增加時，其轉動動能也會增加。 \n 需要注意的是，轉動動能只是物體繞著某一軸線旋轉所擁有的能量，與物體的線性運動沒有關係。在實際應用中，轉動動能通常會與物體的線性動能一起考慮，以計算物體的總機械能。 \n \n", 'tags': '', 'url': 'Chat GPT.html'}, {'title': 'W11', 'text': '', 'tags': '', 'url': 'W11.html'}, {'title': 'TOEIC檢測簡介', 'text': '\xa0https://www.toeic.com.tw/toeic/listening-reading/about/introduction/ \n 多益英語測驗（TOEIC®）全名為Test of English for International Communication，是美國ETS®針對母語非英語人士所研發的英語能力測驗，全球每年有超過700萬人次報考。 \n 多益系列測驗（The TOEIC®Program）目前可於全球160個國家施測，至少為1萬4千個以上的企業客戶、教育單位及政府機構所採用。成績不僅具備信度與效度，也具有國際流通度，足以體現考生在實際溝通情境中的英語文能力。 \n TOEIC®Listening and Reading Test本身並沒有所謂的「通過」或「不通過」，而是客觀地將受測者的能力以聽力5～495分、閱讀5～495分、總分10～990分的指標呈現，受測者也可以自評現在的英語能力，進而設定學習的目標分數。 \n 在真實的職場與校園環境中，當需要以英語溝通時，透過多益系列測驗，成績使用單位能夠進一步掌握職員與學習者的能力現況。 \n 也因為多益系列測驗之國際流通度廣闊，眾多國內外企業、學校，皆採用多益系列測驗作為評核人才英語程度之標準。 \n \n', 'tags': '', 'url': 'TOEIC檢測簡介.html'}, {'title': 'TOEFI簡介', 'text': 'TOEFL iBT測驗包含四個部分，考生必須在3個小時內完成全部測驗。 \n \n 閱讀測驗–評量考生在大學校園求學時，閱讀課堂上的教材及文章之理解能力。 \n 聽力測驗–評量考生在大學校園中，對英語的口語聽力理解能力。 \n 口說測驗–評量考生在大學校園的學術環境下、使用英語進行口語表達的能力。 \n 寫作測驗–評量考生在大學校園的課堂上，能否適當的使用英語進行寫作的能力。 \n TOEFL iBT與TOEFL ITP有什麼不同？ \n \n 托福網路測驗(TOEFL iBT ® )與托福紙筆測驗(TOEFL ITP ® )二種測驗皆為ETS所研發的托福測驗，只是在測驗形態、測驗設備、題型及時間等執行測驗方式的不同，而二種托福測驗的出題大方向及測驗範疇相同，皆是針對個人的校園及學術英語能力進行評量，都是最有效的學術英語能力評量工具。由於二種測驗的後勤作業與成本並不相同，因此在測驗價格上也有很大的差別。 托福紙筆測驗(TOEFL ITP ® )是用紙、筆填寫答案卡方式，以選擇題方式測驗考生的聽力、文法結構與閱讀能力三大項目，目前不考口說與寫作。測驗對象是國際交換學生、條件式入學學生、語言學校、中等學校與成人學校的學生及大學國際化教育計劃的學生，而TOEFL ITP的成績也常做為社區學院與獎助計劃申請者之報名條件。完整測驗時間為115分鐘，測驗費用為新台幣1,200元。 托福網路測驗(TOEFL iBT ® )是現階段北美洲大學入學許可之認證考試，由原先之TOEFL CBT電腦型態測驗於2006年9月停辦後，所改制而成。托福網路測驗(TOEFL iBT ® )是使用電腦與耳機麥克風，透過網路即時連線至ETS進行線上測驗，考試範圍涵蓋「聽、說、讀、寫」四項技能，並採取整合技能(Integrated Skills)方試測驗，完整測驗時間為3小時 ，測驗費用為美金235元（約新台幣6,900元）。 \n \n', 'tags': '', 'url': 'TOEFI簡介.html'}, {'title': 'GRE簡介', 'text': 'GRE全名為Graduate Record Examinations，是由GRE委員會委託美國教育測驗服務社ETS所主辦的美國研究所入學考試。GRE的一般適用對象為申請美國研究所（或博士）課程的學生，科系包含法律（碩士、JD）、MBA、商（管）學院專業型碩士（例如Finance、Marketing）、工程（Engineering）、科學（Science）、人文科學（Humanities），以及教育（Education）…等。除了申請者的大學成績、推薦信以及其他的備審文件（例如讀書計畫、申論題）外，GRE成績提供了美國各大學審核委員會（Admissions Committee）一個更客觀性的指標，來評估申請者就讀碩士（或博士）課程的資格與條件。 \n 除了GRE考試之外，部分學校也會要求申請人提供GRE Subject TEST的成績證明，但什麼是GRE Subject TEST呢？下一段將為你說明。 \n', 'tags': '', 'url': 'GRE簡介.html'}, {'title': 'NGINX', 'text': 'http://192.168.1.36 \n', 'tags': '', 'url': 'NGINX.html'}, {'title': 'Personal profile', 'text': '2023/01/08通過全民英檢初級', 'tags': '', 'url': 'Personal profile.html'}]};